import './App.css';
import React, { useState } from 'react';
import {eyesData} from './eyes.js';

const App = ({ CharacterPart,  CharacterSelector}) => {
const [eyes, setEyes] = React.useState(eyesData[0].url);
const [lips, setLips] = React.useState(null);
const onClickEyes = (item) => {
  setEyes(item)
}
const onClickLips = (item) => {
  setLips(item)
}
  return (
    <main className="mainWrapper">
      <CharacterPart eyes = {eyes} lips = {lips}/>
      <CharacterSelector eyesData = {eyesData} onClickEyes = {onClickEyes} onClickLips = {onClickLips} />
    </main>
  );
}

export default App;
